import { useParams } from "react-router";
import { Fragment } from "react/cjs/react.production.min";

const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <p> { params.quoteId } </p>
        </Fragment>
    )
};

export default QuoteDetail;
